import React from "react";
import { Link, HashRouter as Router, Route, Switch } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";

import "./App.css";
import NavBar from "./components/layout/NavBar";
import Dashboard from "./components/layout/Dashboard";
import Pokemon from "./components/pokemon/Pokemon";

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <div className="container">
          <Switch>
            <Route exact path="/" render={() => <Dashboard generations="" />} />
            <Route
              exactly
              pattern="/gen1"
              render={() => <Dashboard generations="1" />}
            />
            <Route
              exact
              path="/gen2"
              render={() => <Dashboard generations="2" />}
            />
            <Route
              exact
              path="/gen3"
              render={() => <Dashboard generations="3" />}
            />
            <Route
              exact
              path="/gen4"
              render={() => <Dashboard generations="4" />}
            />
            <Route
              exact
              path="/gen5"
              render={() => <Dashboard generations="5" />}
            />
            <Route
              exact
              path="/gen6"
              render={() => <Dashboard generations="6" />}
            />
            <Route
              exact
              path="/gen7"
              render={() => <Dashboard generations="7" />}
            />
            <Route exact path="/pokemon/:pokemonIndex" component={Pokemon} />
            <Dashboard />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
